            if (_useMapping)
                return _index < 0 ? "BaseContext.PlayerStateData.CharacterCustomisationData[0].CustomData" : $"BaseContext.PlayerStateData.Outfits[{_index}]";

            return _index < 0 ? "vLc.6f=.l:j[0].wnR" : $"vLc.6f=.cf5[{_index}]";
